import React from "react";
import h from "./header.module.css"
import {logout} from "../../Redux/auth-reducer";


const Header = (props) => {
    return (
        <div className={h.header}>
            Шапка {props.login}
            <button onClick={logout()}>logout</button>
        </div>
    )
}

export default Header
